description:
Verenigde Staten
Thriller / Misdaad
100 minuten

goeie film

met Diane Lane, Colin Hanks en Billy Burke

Jennifer Marsh is agente van de speciale internetdivisie van de FBI. Ze slijt haar nachten met het opspeuren van oplichters, 
perverselingen en andere criminelen die verscholen gaan achter de schijnbaar veilige dekmantel van het internet. Dan stuit zij 
met haar divisie op het lugubere killwithme.com, een mysterieuze site die bezoekers getuige laat zijn van de meest heftige 
martelingen, eindigend in de dood. Hoe meer bezoekers de site krijgt, des te eerder het slachtoffer overlijdt. Jennifer moet er 
voor zorgen dat deze bloeddorstige gek wordt gestopt voordat er nog meer slachtoffers vallen. Dan maakt deze moordenaar het snel 
persoonlijk. . .
